package looping_strPattern;

public class rectangle_pattern
{

	public static void main(String[] args) 
	{
		// TODO Auto-generated method stub
		int row=10;
		int i;
		int j;
		for(i=1; i<=row; i++)
		{
			for (j=1; j<=row; j++)
			{
				System.out.print("*");
			}
			System.out.println();
		}

	}

}
